INSERT INTO PBL_SERVEI_CONFIG (ID, CREATEDDATE, LASTMODIFIEDDATE, CONDICIO_BUS_CLASS, CUSTODIA_CODI, ROLE_NAME, SERVEI_ID, CREATEDBY_CODI, LASTMODIFIEDBY_CODI, ENTITAT_TIPUS, VERSION, PERMES_DOCTIP_DNI, PERMES_DOCTIP_NIE, PERMES_DOCTIP_NIF, PERMES_DOCTIP_PAS, ACTIU_CAMP_LLIN1, ACTIU_CAMP_LLIN2, ACTIU_CAMP_NOM, JUSTIFICANT_XPATH, JUSTIFICANT_TIPUS, COMPROVAR_DOCUMENT, PERMES_DOCTIP_CIF, DOCUMENT_OBLIGATORI, ACTIU_CAMP_NOMCOMP, ACTIU_CAMP_DOC, AJUDA, FITXER_AJUDA_NOM, FITXER_AJUDA_MIME, FITXER_AJUDA_CONTINGUT, ACTIVA_GESTIO_XSD, UNITAT_DIR3, ACTIU, UNITAT_DIR3_FROM_ENTITAT, MAX_PETICIONS_MIN, INI_DADES_ESPECIFIQUES, USE_AUTO_CLASSE, ADD_DADES_ESPECIFIQUES, ENVIAR_SOLICITANT) VALUES (17289, TO_DATE('2018-09-18 13:37:12', 'YYYY-MM-DD HH24:MI:SS'), TO_DATE('2020-02-13 12:16:03', 'YYYY-MM-DD HH24:MI:SS'), NULL, NULL, NULL, 'SVDVTUWS01', 'u92813', 'e41516830j', NULL, 3, 1, 1, 0, 0, 1, 1, 1, NULL, 0.0, 0, 0, 0, 1, 1, '<div>El campo tipo de documento y núm. de documento es obligatorio.</div><div>&nbsp;Número de documento según el TipoDocumentacion.</div><div>Este campo contiene el número de documento del ciudadano del que se quiere consultar sus datos, según se trate de un ciudadano español o extranjero. La codificación de este campo es la siguiente:</div><div>- DNI (ciudadano español): 8 dígitos + Carácter Control.</div><div>- NIE (ciudadano extranjero): [X,Y,Z] + 7 dígitos + Carácter Control.</div><div>Aquellos DNIs y NIEs que tengan menos de 8 dígitos deberán ser rellenados con 0´s por la izquierda</div><div>Si la documentación está informada, se realiza la consulta por este dato. Si no está informada, será obligatorio informar al menos Nombre Apellido1 y Fecha Nacimiento.</div>', NULL, 'application/octet-stream', NULL, 0, NULL, 1, 0, NULL, 0, 0, 1, 0);
